import styled from "styled-components";

export const ContainerText = styled.div`
	height: 250px;
	display: flex;
	flex-direction: column;
	justify-content: center;
	align-items: center;
`;

export const Logo = styled.div`
	display: flex;
	justify-content: space-between;

	.logo-image {
		padding: 10px;
		height: 70px;
		width: auto;
	}
	.logo-name {
		padding: 10px;
		height: 37px;
		width: auto;
	}
`;

export const Texto = styled.p`
	text-align: center;
	color: black;
	font-size: 50px;
`;

export const Span = styled.span`
	color: ${(props) => (props.primary ? "#ffab07" : "#87d3b8")};
`;

export const ContainerGift = styled.div`
	display: flex;
	justify-content: space-around;
`;

export const GiftType = styled.div`
	display: flex;
	flex-direction: column;
	justify-content: center;
	align-items: center;
	text-align: center;
`;

export const Barra = styled.button`
	border-radius: 30px;
	border: 1px solid #87d3b8;
	width: 230px;
	height: 10px;
	background: white;
	background: linear-gradient(90deg, #ffab07 60%, white 60%);
	background: ${(props) => (props.primary ? "#ffab07" : "#87d3b8")};
`;

export const Footer = styled.img`
	height: auto;
	width: 100%;
`;
